private static String validRegionsString() {
  final String delimiter = ", ";
  Regions[] regions = Regions.values();
  StringBuilder sb = new StringBuilder();
  for (int i = 0; i < regions.length; i++) {
    if (i > 0) {
      sb.append(delimiter);
    }
    sb.append(regions[i].getName());
  }
  return sb.toString();

}
